sys_variable_value.value:
(function execute(inputs, outputs) {
    // ... code ...
    var fields = inputs.given_fields;
    var newFields = [];
    fields.forEach(function (field) {
        // tabLabel is project_overview.title
        if (field.tabLabel.toString() === "project_overview.title") {
            field.value = inputs.given_acq_package.project_overview.title;
        }
        // tabLabel is project_overview.scope
        if (field.tabLabel.toString() === "project_overview.scope") {
            field.value = inputs.given_acq_package.project_overview.scope;
        }
        // tabLabel is organization.service_agency (needs display value)
        if (field.tabLabel.toString() === "organization.service_agency") {
            // display value
            var dis_val = getDisplayValue("service_agency", inputs.given_acq_package.organization.service_agency);
            field.value = dis_val;
        }
        // tabLabel is composite.organization
        if (field.tabLabel.toString() === "composite.organization") {
          	field.value = inputs.given_acq_package.organization.computed_name;
        }
        // tabLabel is contacts#mo.formal_name
        if (field.tabLabel.toString() === "contacts#mo.formal_name") {
            field.value = inputs.mo_contact.formal_name;
        }
        // package has a COR contact
        if (inputs.cor_contact) {
            // tabLabel is contacts#cor.formal_name
            if (field.tabLabel.toString() === "contacts#cor.formal_name") {
                field.value = inputs.cor_contact.formal_name;
            }
            // tabLabel is contacts#cor.email
            if (field.tabLabel.toString() === "contacts#cor.email") {
                field.value = inputs.cor_contact.email;
            }
            // tabLabel is contacts#cor.phone_and_extension
            if (field.tabLabel.toString() === "contacts#cor.phone_and_extension") {
                field.value = inputs.cor_contact.phone_and_extension;
            }
            // tabLabel is contacts#cor.dodaac
            if (field.tabLabel.toString() === "contacts#cor.dodaac") {
                field.value = inputs.cor_contact.dodaac;
            }

        }
        // package has an ACOR contact
        if (inputs.acor_contact) {
            // tabLabel is contacts#acor.formal_name
            if (field.tabLabel.toString() === "contacts#cor.formal_name") {
                field.value = inputs.acor_contact.formal_name;
            }
            // tabLabel is contacts#acor.email
            if (field.tabLabel.toString() === "contacts#cor.email") {
                field.value = inputs.acor_contact.email;
            }
            // tabLabel is contacts#acor.phone_and_extension
            if (field.tabLabel.toString() === "contacts#cor.phone_and_extension") {
                field.value = inputs.acor_contact.phone_and_extension;
            }
            // tabLabel is contacts#acor.dodaac
            if (field.tabLabel.toString() === "contacts#cor.dodaac") {
                field.value = inputs.acor_contact.dodaac;
            }
        }
        // current Contract exists
        if (inputs.given_acq_package.current_contract_and_recurring_information.current_contract_exists == "YES") {
            // tabLabel is current_contract.incumbent_contractor_name
            if (field.tabLabel.toString() === "current_contract.incumbent_contractor_name") {
                field.value = inputs.given_acq_package.current_contract_and_recurring_information.incumbent_contractor_name;
            }
            // tabLabel is current_contract.contract_number
            if (field.tabLabel.toString() === "current_contract.contract_number") {
                field.value = inputs.given_acq_package.current_contract_and_recurring_information.contract_number;
            }
            // tabLabel is current_contract.task_delivery_order_number
            if (field.tabLabel.toString() === "current_contract.task_delivery_order_number") {
                field.value = inputs.given_acq_package.current_contract_and_recurring_information.task_delivery_order_number;
            }
            // tabLabel is current_contract.contract_order_expiration_date
            if (field.tabLabel.toString() === "current_contract.contract_order_expiration_date") {
                field.value = inputs.given_acq_package.current_contract_and_recurring_information.contract_order_expiration_date;
            }
        }
        // tabLabel is composite.requested_pop_text
        if (field.tabLabel.toString() === "composite.requested_pop_text") {
            // Format the base Period text as "Base period: N <Day(s) | Month(s) | Year(s)>"
            var basePeriod = inputs.given_acq_package.period_of_performance.base_period;
            var formattedText = "";
            formattedText += basePeriod.period_type.getDisplayValue();
            formattedText += " period: ";
            formattedText += basePeriod.period_unit_count.getDisplayValue();
            formattedText += " ";
            formattedText += basePeriod.period_unit.getDisplayValue();

            // The option_periods on the record is a formatted like "ID1,ID2". Those IDs can then
            // be looked up on the atat_period GlideRecord to fetch the full object data.
            var optionPeriodIds = inputs.given_acq_package.period_of_performance.option_periods.split(',');
            var gr = new GlideRecord("x_g_dis_atat_period");
            for (var i = 0; i < optionPeriodIds.length; i++) {
                gr.get(optionPeriodIds[i]);
                // If the period is an option period, format the text
                if (gr.period_type == "OPTION") {
                    // Format the option Period text as "Option period M: N <Days(s) | Month(s) | Year(s)>"
                    formattedText += ", ";
                    formattedText += gr.period_type.getDisplayValue();
                    formattedText += " period ",
                        formattedText += gr.option_order.getDisplayValue();
                    formattedText += ": ";
                    formattedText += gr.period_unit_count.getDisplayValue();
                    formattedText += " ";
                    formattedText += gr.period_unit.getDisplayValue();
                }
            }
            field.value = formattedText;

        }
        // tabLabel is composite.pop_start_date_no_sooner_than_text AND the period of performance time_frame is NO_SOONER_THAN
        if (field.tabLabel.toString() === "composite.pop_start_date_no_sooner_than_text" && inputs.given_acq_package.period_of_performance.time_frame === "NO_SOONER_THAN") {
            field.value = inputs.given_acq_package.period_of_performance.requested_pop_start_date;
        }
        // tabLabel is composite.pop_start_date_not_later_than_text AND the period of performance time_frame is NO_LATER_THAN
        if (field.tabLabel.toString() === "composite.pop_start_date_not_later_than_text" && inputs.given_acq_package.period_of_performance.time_frame === "NO_LATER_THAN") {
            field.value = inputs.given_acq_package.period_of_performance.requested_pop_start_date;
        }
        // tabLabel is project_overview.emergency_declaration_yes AND in support of an emergency declaration
        if (field.tabLabel.toString() === "project_overview.emergency_declaration_yes" && inputs.given_acq_package.project_overview.emergency_declaration == "YES") {
            field.value = "X";
        }
        // tabLabel is project_overview.emergency_declaration_no AND NOT in support of an emergency declaration
        if (field.tabLabel.toString() === " project_overview.emergency_declaration_no" && !inputs.given_acq_package.project_overview.emergency_declaration == "NO") {
            field.value = "X";
        }
        // tabLabel is current_contract.current_contract_exists_yes AND a current contract exists
        if (field.tabLabel.toString() === "current_contract.current_contract_exists_yes" && inputs.given_acq_package.current_contract_and_recurring_information.current_contract_exists === "YES") {
            field.value = "X";
        }
        // tabLabel is current_contract.current_contract_exists_no AND a current contract DOES NOT exist
        if (field.tabLabel.toString() === "current_contract.current_contract_exists_no" && inputs.given_acq_package.current_contract_and_recurring_information.current_contract_exists === "NO") {
            field.value = "X";
        }
        // tabLabel is fair_opportunity.exception_to_fair_opportunity_yes AND there is an exception to the fair opportunity process
        if (field.tabLabel.toString() === "fair_opportunity.exception_to_fair_opportunity_yes" &&
            inputs.given_acq_package.fair_opportunity.exception_to_fair_opportunity === "YES_FAR_16_505_B_2_I_B" || inputs.given_acq_package.fair_opportunity.exception_to_fair_opportunity === "YES_FAR_16_505_B_2_I_C"
            || inputs.given_acq_package.fair_opportunity.fair_opportunity.exception_to_fair_opportunity === "YES_FAR_16_505_B_2_I_A") {
            field.value = "X";
        }
        // tabLabel is fair_opportunity.exception_to_fair_opportunity_no AND there IS NOT an exception to the fair opportunity process
        if (field.tabLabel.toString() === "fair_opportunity.exception_to_fair_opportunity_no" &&
            inputs.given_acq_package.fair_opportunity.exception_to_fair_opportunity === "NO_NONE") {
            field.value = "X";
        }
        // tabLabel is period_of_performance.recurring_requirement_yes AND there is a recurring requirement
        if (field.tabLabel.toString() === "period_of_performance.recurring_requirement_yes" && inputs.given_acq_package.period_of_performance.recurring_requirement === "YES") {
            field.value = "X";
        }
        // tabLabel is period_of_performance.recurring_requirement_no AND there is NOT a recurring requirement
        if (field.tabLabel.toString() === "period_of_performance.recurring_requirement_no" && inputs.given_acq_package.period_of_performance.recurring_requirement === "NO") {
            field.value = "X";
        }
        // tabLabel is period_of_performance.pop_start_request_yes AND there is a requested PoP start date
        if (field.tabLabel.toString() === "period_of_performance.pop_start_request_yes" && inputs.given_acq_package.period_of_performance.pop_start_request === "YES") {
            field.value = "X";
        }
        // tabLabel is period_of_performance.pop_start_request_no AND there is NOT a requested PoP start date
        if (field.tabLabel.toString() === "period_of_performance.pop_start_request_no" && inputs.given_acq_package.period_of_performance.pop_start_request === "NO") {
            field.value = "X";
        }
        // tabLabel is sensitive_information.baa_required_yes AND a BAA is required
        if (field.tabLabel.toString() === "sensitive_information.baa_required_yes" && inputs.given_acq_package.sensitive_information.baa_required === "YES") {
            field.value = "X";
        }
        // tabLabel is sensitive_information.baa_required_no AND a BAA is NOT required
        if (field.tabLabel.toString() === "sensitive_information.baa_required_no" && inputs.given_acq_package.sensitive_information.baa_required === "NO") {
            field.value = "X";
        }
        // tabLabel is sensitive_information.potential_to_be_harmful_yes AND public disclosure would be harmful to govt
        if (field.tabLabel.toString() === "sensitive_information.potential_to_be_harmful_yes" && inputs.given_acq_package.sensitive_information.potential_to_be_harmful === "YES") {
            field.value = "X";
        }
        // tabLabel is sensitive_information.potential_to_be_harmful_no AND public disclosure would NOT be harmful to govt
        if (field.tabLabel.toString() === "sensitive_information.potential_to_be_harmful_no" && inputs.given_acq_package.sensitive_information.potential_to_be_harmful === "NO") {
            field.value = "X";
        }
        // tabLabel is sensitive_information.section_508_sufficient_yes AND Section 508 requirements are sufficient
        if (field.tabLabel.toString() === "sensitive_information.section_508_sufficient_yes" && inputs.given_acq_package.sensitive_information.section_508_sufficient === "YES") {
            field.value = "X";
        }
        // tabLabel is sensitive_information.section_508_sufficient_no AND Section 508 requirements are NOT sufficient
        if (field.tabLabel.toString() === "sensitive_information.section_508_sufficient_no" && inputs.given_acq_package.sensitive_information.section_508_sufficient === "NO") {
            field.value = "X";
        }
        // public disclosure would be harmful to govt, specify FOIA Coordinator info
        if (inputs.given_acq_package.sensitive_information.potential_to_be_harmful === "YES") {
            // tabLabel is sensitive_information.foia_full_name
            if (field.tabLabel.toString() === "sensitive_information.foia_full_name") {
                field.value = inputs.given_acq_package.sensitive_information.foia_full_name;
            }
            // tablLabel is sensitive_information.foia_email
            if (field.tabLabel.toString() === "sensitive_information.foia_email") {
                field.value = inputs.given_acq_package.sensitive_information.foia_email;
            }
            // tabLabel is composite.foia_coordinator_address
            if (field.tabLabel.toString() === "composite.foia_coordinator_address") {
                var str1 = inputs.given_acq_package.sensitive_information.foia_street_address_1;
                var str2 = inputs.given_acq_package.sensitive_information.foia_street_address_2;
                var city = inputs.given_acq_package.sensitive_information.foia_city_apo_fpo;
                var state = inputs.given_acq_package.sensitive_information.foia_state_province_state_code;
                var zip = inputs.given_acq_package.sensitive_information.foia_zip_postal_code;
                var country = inputs.given_acq_package.sensitive_information.foia_country;
                var line1 = str1;
                if (str2.length > 0) {
                    line1 += ", " + str2;
                }
                line1 += "\n";
                var line2 = city + ", " + state + " " + zip + "\n";
                var line3 = country;
                field.value = line1 + line2 + line3;

            }


        }
        // tabLabel is contract_type.type_ffp AND contract type is Firm Fixed Price
        if (field.tabLabel.toString() === "contract_type.type_ffp" && inputs.given_acq_package.contract_type.firm_fixed_price) {
            field.value = "X";
        }
        // tabLabel is contract_type.type_tm AND contract type is Time And Materials
        if (field.tabLabel.toString() === "contract_type.type_tm" && inputs.given_acq_package.contract_type.time_and_materials) {
            field.value = "X";
        }
        // tabLabel is contract_type.type_tm_justification AND contract type is Time And Materials
        if (field.tabLabel.toString() === "contract_type.type_tm_justification" && inputs.given_acq_package.contract_type.time_and_materials) {
            field.value = inputs.given_acq_package.contract_type.contract_type_justification;
        }

        var newField = {
            "field_id": field.field_id,
            "field_val": field.value,
            "field_cat": field.category,
            "field_selected": "false"
        }

        newFields.push(newField);
    });
    outputs.fields = newFields;

    // This will get the display value
    function getDisplayValue(choice_set_element, choice_value) {
        var sysChoice = new GlideRecord("sys_choice");
        sysChoice.addQuery("element", choice_set_element);
        sysChoice.addQuery("value", choice_value);
        sysChoice.query();
        while (sysChoice.next()) {
            return sysChoice.label;
        }
    };

})(inputs, outputs);

