        }
        // tabLabel is period_of_performance.recurring_requirement_no AND there is NOT a recurring requirement
        if (field.tabLabel.toString() === "period_of_performance.recurring_requirement_no" && inputs.given_acq_package.period_of_performance.recurring_requirement === "NO") {
            field.value = "X";
        }
        // tabLabel is period_of_performance.pop_start_request_yes AND there is a requested PoP start date
        if (field.tabLabel.toString() === "period_of_performance.pop_start_request_yes" && inputs.given_acq_package.period_of_performance.pop_start_request === "YES") {
            field.value = "X";
        }
        // tabLabel is period_of_performance.pop_start_request_no AND there is NOT a requested PoP start date
        if (field.tabLabel.toString() === "period_of_performance.pop_start_request_no" && inputs.given_acq_package.period_of_performance.pop_start_request === "NO") {
            field.value = "X";
        }
        // tabLabel is sensitive_information.baa_required_yes AND a BAA is required
        if (field.tabLabel.toString() === "sensitive_information.baa_required_yes" && inputs.given_acq_package.sensitive_information.baa_required === "YES") {
            field.value = "X";
        }
        // tabLabel is sensitive_information.baa_required_no AND a BAA is NOT required
        if (field.tabLabel.toString() === "sensitive_information.baa_required_no" && inputs.given_acq_package.sensitive_information.baa_required === "NO") {
            field.value = "X";
        }
        // tabLabel is sensitive_information.potential_to_be_harmful_yes AND public disclosure would be harmful to govt
        if (field.tabLabel.toString() === "sensitive_information.potential_to_be_harmful_yes" && inputs.given_acq_package.sensitive_information.potential_to_be_harmful === "YES") {
            field.value = "X";
        }
        // tabLabel is sensitive_information.potential_to_be_harmful_no AND public disclosure would NOT be harmful to govt
        if (field.tabLabel.toString() === "sensitive_information.potential_to_be_harmful_no" && inputs.given_acq_package.sensitive_information.potential_to_be_harmful === "NO") {
            field.value = "X";
        }
        // tabLabel is sensitive_information.section_508_sufficient_yes AND Section 508 requirements are sufficient
        if (field.tabLabel.toString() === "sensitive_information.section_508_sufficient_yes" && inputs.given_acq_package.sensitive_information.section_508_sufficient === "YES") {
            field.value = "X";
        }
        // tabLabel is sensitive_information.section_508_sufficient_no AND Section 508 requirements are NOT sufficient
        if (field.tabLabel.toString() === "sensitive_information.section_508_sufficient_no" && inputs.given_acq_package.sensitive_information.section_508_sufficient === "NO") {
            field.value = "X";
        }
        // public disclosure would be harmful to govt, specify FOIA Coordinator info
        if (inputs.given_acq_package.sensitive_information.potential_to_be_harmful === "YES") {
            // tabLabel is sensitive_information.foia_full_name
            if (field.tabLabel.toString() === "sensitive_information.foia_full_name") {
                field.value = inputs.given_acq_package.sensitive_information.foia_full_name;
            }
            // tablLabel is sensitive_information.foia_email
            if (field.tabLabel.toString() === "sensitive_information.foia_email") {
                field.value = inputs.given_acq_package.sensitive_information.foia_email;
            }
            // tabLabel is composite.foia_coordinator_address
            if (field.tabLabel.toString() === "composite.foia_coordinator_address") {
                var str1 = inputs.given_acq_package.sensitive_information.foia_street_address_1;
                var str2 = inputs.given_acq_package.sensitive_information.foia_street_address_2;
                var city = inputs.given_acq_package.sensitive_information.foia_city_apo_fpo;
                var state = inputs.given_acq_package.sensitive_information.foia_state_province_state_code;
                var zip = inputs.given_acq_package.sensitive_information.foia_zip_postal_code;
                var country = inputs.given_acq_package.sensitive_information.foia_country;
                var line1 = str1;
                if (str2.length > 0) {
                    line1 += ", " + str2;
                }
                line1 += "\n";
                var line2 = city + ", " + state + " " + zip + "\n";
                var line3 = country;
                field.value = line1 + line2 + line3;

            }


        }
        // tabLabel is contract_type.type_ffp AND contract type is Firm Fixed Price
        if (field.tabLabel.toString() === "contract_type.type_ffp" && inputs.given_acq_package.contract_type.firm_fixed_price) {
            field.value = "X";
        }
        // tabLabel is contract_type.type_tm AND contract type is Time And Materials
        if (field.tabLabel.toString() === "contract_type.type_tm" && inputs.given_acq_package.contract_type.time_and_materials) {
            field.value = "X";
        }
        // tabLabel is contract_type.type_tm_justification AND contract type is Time And Materials
        if (field.tabLabel.toString() === "contract_type.type_tm_justification" && inputs.given_acq_package.contract_type.time_and_materials) {
            field.value = inputs.given_acq_package.contract_type.contract_type_justification;
        }

        var newField = {
            "field_id": field.field_id,
            "field_val": field.value,
            "field_cat": field.category,
            "field_selected": "false"
        }

        newFields.push(newField);
    });
    outputs.fields = newFields;

    // This will get the display value
    function getDisplayValue(choice_set_element, choice_value) {
        var sysChoice = new GlideRecord("sys_choice");
        sysChoice.addQuery("element", choice_set_element);
        sysChoice.addQuery("value", choice_value);
        sysChoice.query();
        while (sysChoice.next()) {
            return sysChoice.label;
        }
    };

})(inputs, outputs);

